import React, { Component } from 'react';
import Body from './Body';
import backgroundImage from '../assets/cervinia.jpg';

export default class Home extends Component {
    render() {
        return (
            <div>
                <img src={backgroundImage} alt="Cervinia" className="heroImg" />
                <Body />
            </div>
        );
    }
}
